import React from "react";
import Card from './card.js'

const cards = [
    {
        id: 1,
        description: "Visite la hermosa ciudad de barcelona, uno de los mejores destinos de España",
        image: '../assets/barcelona.jpg',
    }
]

function Cards() {
    return(
        <div>
            <Card/>
        </div>
    )
}
export default Cards
